import React from 'react';
import './AboutContent.css';
import frontendImage from '../src/assets/frontend.png'; // Import your images
import blockchainImage from '../src/assets/blockhain.png';
import chainlinkImage from '../src/assets/chainlink.png';

export default function AboutContent() {
    return (
        <div className='about-content'>
            <h2>About Me</h2>
            <div className='skill' id='frontend'>
                <h3>
                    <img src={frontendImage} alt="Front-end Development" /> 
                    <a href='#frontend-link'>Front-end Development</a>
                </h3>
                {/* Rest of your content */}
            </div>
            <div className='skill' id='blockchain'>
                <h3>
                    <img src={blockchainImage} alt="Blockchain Technology" /> 
                    <a href='#blockchain-link'>Blockchain Technology</a>
                </h3>
                {/* Rest of your content */}
            </div>
            <div className='skill' id='chainlink'>
                <h3>
                    <img src={chainlinkImage} alt="Data Integration with Chainlink" /> 
                    <a href='https://www.chain.link' target='_blank'>Data Integration with Chainlink</a>
                </h3>
                {/* Rest of your content */}
            </div>
        </div>
    )
}
